DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `checkCount`()
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE id BIGINT;
	DECLARE newCouponsCount INT;
	DECLARE oldCouponsCount INT;
	DECLARE affectedTermsCount INT DEFAULT 0;
	DECLARE foundTermsCount INT DEFAULT 0;

	#Update categories
	DECLARE termCursor CURSOR FOR SELECT t.id, t.coupon_count oldCouponsCount, count(t.id) AS newCouponsCount FROM category t
		INNER JOIN coupon_n_category tc ON t.id = tc.category_id
		INNER JOIN coupon c ON tc.coupon_id = c.id and c.status = 'active'
		WHERE t.type = 'category' AND t.status = 'enable'
		GROUP BY t.id
		ORDER BY t.coupon_count ASC, t.title DESC;
	#Update stores
	DECLARE storeTermCursor CURSOR FOR SELECT t.id, t.coupon_count as oldCouponsCount, count(t.id) as newCouponsCount FROM store t
		INNER JOIN coupon c ON c.store_id = t.id 
			AND t.status = 'enable' 
			AND t.type = 'store' 
			AND c.status = 'active'
	GROUP BY t.id;

  SET SESSION time_zone = '-05:00';

	OPEN termCursor;
	BEGIN
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
		updateCategoriesLoop: LOOP
			FETCH termCursor INTO id, oldCouponsCount, newCouponsCount;			
			IF done THEN
				LEAVE updateCategoriesLoop;
			END IF;
			IF oldCouponsCount IS NULL OR oldCouponsCount != newCouponsCount THEN
				UPDATE category t SET t.`coupon_count` = newCouponsCount WHERE t.`id` = id;
				#Update affected records number
				SET affectedTermsCount = affectedTermsCount + 1;
			END IF;
			SET foundTermsCount = foundTermsCount + 1;
		END LOOP;
	END;
	CLOSE termCursor;
	#SELECT affectedTermsCount as "Affected Categories", foundTermsCount as "Found terms";
	#INSERT INTO wtp_cronjob(name,affected_rows_count, found_rows_count,create_time) values('checkCount' , affectedTermsCount,foundTermsCount,now());

	OPEN storeTermCursor;
	BEGIN		
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
		SET done = FALSE;
		#Reset counters
		SET affectedTermsCount = 0;
		SET foundTermsCount = 0;
		updateStoresLoop: LOOP
			FETCH storeTermCursor INTO id, oldCouponsCount, newCouponsCount;			
			IF done THEN
				LEAVE updateStoresLoop;
			END IF;
			IF oldCouponsCount IS NULL OR oldCouponsCount != newCouponsCount THEN
				UPDATE store t SET t.`coupon_count` = newCouponsCount WHERE t.`id` = id;
				#Update affected records number
				SET affectedTermsCount = affectedTermsCount + 1;
			END IF;
			SET foundTermsCount = foundTermsCount + 1;
		END LOOP;
	END;
	CLOSE storeTermCursor;
	#SELECT affectedTermsCount as "Affected stores", foundTermsCount as "Found stores";
	#INSERT INTO wtp_cronjob(name,affected_rows_count, found_rows_count,create_time) values('checkCount' , affectedTermsCount,foundTermsCount,now());
	UPDATE store s set s.status = 'pending' where s.coupon_count = 0;
END;;
DELIMITER ;

